//? Notes
//? THe main file that will be bundeled into one file - Link all used files for the front end in here.
import "@babel/polyfill";
import { login, logout } from "./login";
import {
  updateNameOrEmail,
  updatePassword,
  resetPassword,
  forgotPassword,
} from "./updateUser";

const loginForm = document.querySelector("#form");
const accountForm = document.getElementById("accountForm");
const resetForm = document.getElementById("resetForm");
const forgotPasswordForm = document.getElementById("forgotPasswordForm");

const logoutButton = document.getElementById("logoutButton");

//? Notes
if (loginForm) {
  loginForm.addEventListener("submit", (e) => {
    e.preventDefault();
    const emailInput = document.getElementById("emailInput");
    const passwordInput = document.getElementById("passwordInput");
    const email = emailInput.value;
    const password = passwordInput.value;
    login(email, password);
  });
}

if (logoutButton) {
  logoutButton.addEventListener("click", (e) => {
    e.preventDefault();
    logout();
  });
}

if (accountForm) {
  accountForm.addEventListener("submit", (e) => {
    e.preventDefault();
    const accountEmailForm = document.getElementById("accountPageEmailInput");
    const accountNameForm = document.getElementById("accountPageNameInput");
    const email = accountEmailForm.value;
    const name = accountNameForm.value;
    updateNameOrEmail(name, email);
    console.log("Account form press run through");
  });

  document
    .getElementById("accountPasswordForm")
    .addEventListener("submit", (e) => {
      e.preventDefault();
      const currentPasswordInput = document.getElementById(
        "accountPageCurrentPasswordInput"
      );
      const passwordInput = document.getElementById("accountPagePasswordInput");
      const passwordConfirmInput = document.getElementById(
        "accountPageConfirmPasswordInput"
      );

      updatePassword(
        currentPasswordInput.value,
        passwordInput.value,
        passwordConfirmInput.value
      );
    });
}

if (resetForm) {
  resetForm.addEventListener("submit", (e) => {
    console.log("CLicked reset form button");
    e.preventDefault();
    const password = document.getElementById("resetPassword");
    const passwordConfirm = document.getElementById("resetPasswordConfirm");
    const tokenInput = document.getElementById("resetPasswordToken");
    resetPassword(tokenInput.value, password.value, passwordConfirm.value);
  });
}

if (forgotPasswordForm) {
  forgotPasswordForm.addEventListener("submit", (e) => {
    e.preventDefault();
    const emailInput = document.getElementById("forgotEmailInput");
    forgotPassword(emailInput.value);
  });
}
